import { Link } from "react-router-dom";
import "../App.scss"
import ArrowBackIosIcon from '@material-ui/icons/ArrowBackIos';

const SubHeader = (props) => {

    const {header1, header2, imgUrl, path, permission, state} = props

    return (
        <div className='sub-header'>
            <h1>{permission ? <Link to={{pathname: path, state: state}}><ArrowBackIosIcon /></Link> : null} {header1}</h1>
            {header2 ? <h2>{header2}</h2> : null}
            {imgUrl ? <img src={imgUrl} alt={imgUrl} /> : null}
        </div>
    )
}

export default SubHeader
